import React from "react"
import PropTypes from "prop-types"

function Post(props) {

  const posts = [
    {id: 1,  content: 'Добро пожаловать в документацию React!'},
    {id: 2,  content: 'React можно установить из npm.'}
  ];


  const content = props.posts.map((post) =>
    <div key={post.id}>

      <p>{post.content}</p>
    </div>);
  return (
    <div>

      {content}
    </div>);
}



export default Post
